import React, { Component } from "react";
import "../Style/main.css";
import axios from "axios";

const API = "http://127.0.0.1:8000/posts/";

class Fetch extends Component {
  constructor(props) {
    super(props);
    this.state = {
      Posts: [],
      isLoading: false,
      error: null
    };
  }

  componentDidMount() {
    this.setState({ isLoading: true });

    axios
      .get(API)
      .then(result =>
        this.setState({
          Posts: result.data.Posts,
          isLoading: false
        })
      )
      .catch(error =>
        this.setState({
          error,
          isLoading: false
        })
      );
  }

  render() {
    const Posts = { Posts };
    return (
      <div>
        const Posts = {Posts};
        <ul key={Posts.items}>
          <li>{Posts.Post}</li>
          <li>{Posts.author}</li>
        </ul>
      </div>
    );
  }
}

export default Fetch;
